        logger.info(f"Updated header timestamp to {now}")

    def ensure_zero_padding(self, data: List[Dict]) -> List[Dict]:
        """Ensure all fields are zero-padded"""
        for record in data:
            for k, v in record.items():
                if isinstance(v, str) and v.isdigit():
                    record[k] = v.zfill(len(v))
        logger.info("Applied zero-padding to all fields")
        return data

